export function* userSignUp (data) {
    console.warn('data in ', userSignUp)
    let result = fetch (yield fetch("http://localhost:5000/check", {
        method:"POST",
        body:"sd",
        headers:{
            "Content-Type":"application/json"
        }
    }))
}
